import React from "react";

function Nav() {

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <Link className="navbar-brand" to="/">
        What todo?
      </Link>
      <a className="navbar-brand" href="/">
        About
      </a>
      <a className="navbar-brand" href="/todo">
        Todo List
      </a>
    </nav>
  );
}

export default Nav;
